<p class=\"valProp-item-description\">Driven by our passion for travel, the Agoda team works hard to bring you the cheapest prices on hotels, resorts, unique homes, vacation rentals, and more. Our huge selection of accommodations will let you plan the perfect trip. From adventure travel and backpacking to honeymoons and family vacations, we\'ve got you covered.</p>";s:13:"store_aff_url";s:0:"";s:10:"page_title";s:0:"";}";s:15:"taxonomy_term_3";s:3348:"a:10:{s:7:"popular";s:3:"yes";s:9:"store_url";s:21:"https://www.amazon.in";s:10:"store_logo";s:73:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/amazon_logo.jpeg";s:12:"store_banner";s:74:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/amazon_banner.jpg";s:11:"store_color";s:7:"#f5a623";s:3:"map";s:397:"<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d26308.399440615674!2d-122.36424578334478!3d47.609777770555574!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xeb14c9f837c2c261!2sAmazon!5e0!3m2!1sen!2sin!4v1603442414860!5m2!1sen!2sin\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"</iframe>";s:5:"video";s:229:"<iframe width=\"424\" height=\"238\" src=\"https://www.youtube.com/embed/2zpcCO0eUTQ\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>";s:11:"store_intro";s:2290:"<p>Amazon.com, Inc., doing business as Amazon, is an American electronic commerce and cloud computing company based in Seattle, Washington that was founded by Jeff Bezos on July 5, 1994. The tech giant is the largest Internet retailer in the world as measured by revenue and market capitalization, and second largest after Alibaba Group in terms of total sales.</p>
<p>The amazon.com website started as an online bookstore and later diversified to sell video downloads/streaming, MP3 downloads/streaming, audiobook downloads/streaming, software, video games, electronics, apparel, furniture, food, toys, and jewelry. The company also produces consumer electronics‚ÄîKindle e-readers, Fire tablets, Fire TV, and Echo‚Äîand is the world\'s largest provider of cloud infrastructure services (IaaS and PaaS). Amazon also sells certain low-end products under its in-house brand AmazonBasics.</p>
<p>Amazon has separate retail websites for</p>
<ul>
<li>the United States</li>
<li>the United Kingdom and Ireland</li>
<li>France</li>
<li>Canada</li>
<li>Germany</li>
<li>Italy</li>
<li>Spain</li>
<li>Netherlands</li>
<li>Australia</li>
<li>Brazil</li>
<li>Japan</li>
<li>China</li>
<li>India</li>
<li>and Mexico</li>
</ul>
<p>In 2016, Dutch, Polish, and Turkish language versions of the German Amazon website were also launched.</p>
<blockquote>
<p>Amazon also offers international shipping of some of its products to certain other countries.</p>
</blockquote>
<p>In 2015, Amazon surpassed Walmart as the most valuable retailer in the United States by market capitalization. Amazon is the fourth most valuable public company in the world (behind only Apple, Alphabet, and Microsoft), the largest Internet company by revenue in the world, and after Walmart, the second largest employer in the United States.</p>
<p>In 2017, Amazon acquired Whole Foods Market for $13.4 billion, which vastly increased Amazon\'s presence as a brick-and-mortar retailer. The acquisition was interpreted by some as a direct attempt to challenge Walmart\'s traditional retail stores.</p>
<p>In 2018, for the first time, Jeff Bezos released in Amazon\'s shareholder letter the number of Amazon Prime subscribers, which at 100 million, is approximately 64% of households in the United States.</p>";s:13:"store_aff_url";s:0:"";s:10:"page_title";s:0:"";}";s:15:"taxonomy_term_6";s:2246:"a:10:{s:7:"popular";s:3:"yes";s:9:"store_url";s:21:"https://www.amazon.in";s:10:"store_logo";s:71:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/ebay_logo.jpeg";s:12:"store_banner";s:88:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/ebay_banner-e1531401747234.jpeg";s:11:"store_color";s:7:"#89c507";s:3:"map";s:362:"<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d12681.227395997765!2d-121.927992!3d37.382575!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x1063c6e2a670c5ca!2seBay!5e0!3m2!1sen!2sin!4v1603443303958!5m2!1sen!2sin\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>";s:5:"video";s:230:"<iframe width=\"1600\" height=\"900\" src=\"https://www.youtube.com/embed/J7knE45LWjM\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>";s:11:"store_intro";s:1210:"<h3>ABOUT EBAY.COM</h3>
<p><strong>eBay Inc.</strong> is an American multinational e-commerce corporation based in San Jose, California that facilitates consumer-to-consumer and business-to-consumer sales through its website. eBay was founded by Pierre Omidyar in 1995, and became a notable success story of the dot-com bubble.</p>
<p>eBay is a multibillion-dollar business with operations in about 30 countries, as of 2011. The company manages eBay.com, an online auction and shopping website in which people and businesses buy and sell a wide variety of goods and services worldwide. The website is free to use for buyers, but sellers are charged fees for listing items after a limited number of free listings, and again when those items are sold.</p>
<p>In addition to its original auction-style sales, the website has since evolved and expanded to include \"Buy It Now\" shopping; shopping by UPC, ISBN, or other kind of SKU number (via Half.com); online classified advertisements (via Kijiji or eBay Classifieds); online event ticket trading (via StubHub); and other services. It previously offered online money transfers (via PayPal, which was a wholly owned subsidiary of eBay from 2002 to 2015).</p>";s:13:"store_aff_url";s:0:"";s:10:"page_title";s:0:"";}";s:16:"taxonomy_term_12";s:963:"a:10:{s:7:"popular";s:2:"no";s:9:"store_url";s:38:"https://www.lifestylestores.com/in/en/";s:10:"store_logo";s:71:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/lifestyle.jpeg";s:11:"store_color";s:7:"#d32052";s:3:"map";s:365:"<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d14561.216350647466!2d55.807478!3d24.161066!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x814b2280de6e953c!2sLifestyle!5e0!3m2!1sen!2sin!4v1603443730668!5m2!1sen!2sin\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>";s:5:"video";s:230:"<iframe width=\"1600\" height=\"900\" src=\"https://www.youtube.com/embed/lFMsP4AJypg\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>";s:13:"store_aff_url";s:0:"";s:11:"store_intro";s:0:"";s:12:"store_banner";s:0:"";s:10:"page_title";s:0:"";}";s:16:"taxonomy_term_19";s:2653:"a:8:{s:7:"popular";s:3:"yes";s:9:"store_url";s:28:"https://www.skyscanner.co.in";s:10:"store_logo";s:77:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/skyscanner_logo.jpeg";s:12:"store_banner";s:78:"https://demo1.clipmydeals.com/wp-content/uploads/2018/07/skyscanner_banner.jpg";s:11:"store_color";s:7:"#00aece";s:3:"map";s:360:"<iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d14373.00045545399!2d-80.189979!3d25.762301!3m2!1i1024!2