x6b1bdbb2eafb6b02!2sZARA!5e0!3m2!1sen!2sin!4v1603444524637!5m2!1sen!2sin\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>";s:5:"video";s:231:"<iframe width=\"1778\" height=\"1000\" src=\"https://www.youtube.com/embed/0Rf87cXbfLk\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>";s:11:"store_intro";s:3693:"<article class=\"ConfidencePanel-WTumW\">
<h2>FAQS</h2>
<ul>
<li>
<h3>HOW MANY LANGUAGES IS IT POSSIBLE TO BROWSE IN?</h3>
<p>The Zara.com browsing languages are: English, Spanish, Catalan, Galician, Basque, Portuguese, French, Italian, German, Polish, Greek, Romanian, Bulgarian, Croatian, Czech, Slovak, Estonian, Latvian, Lithuanian, Dutch, Swedish, Norwegian, Danish, Russian, Korean, Japanese, Chinese, Malay, Vietnamese, Thai and Turkish.</p>
</li>
<li>
<h3>ARE THE ONLINE STORE PRICES THE SAME AS THOSE IN MY USUAL ZARA STORE?</h3>
<p>Yes, but if there is any difference between the prices shown on the website and those marked on the label on the clothes, the correct price will be the one shown on the purchase ticket.</p>
</li>
<li>
<h3>WHAT IS YOUR PRICE ADJUSTMENT POLICY?</h3>
<p>Price adjustments will not be done for items with a reduced price.</p>
</li>
<li>
<h3>ARE OUT-OF-STOCK ITEMS RESTOCKED?</h3>
<p>If an item is out of stock, we will try to restock it as soon as possible. If no stock is available, it will be removed from the website.</p>
</li>
<li>
<h3>WILL I RECEIVE THE SAME PRODUCT THAT I SEE IN THE PHOTO?</h3>
<p>Yes, except in the case of products which are hand crafted in which there may be slight differences in the final product.</p>
</li>
<li>
<h3>IS IT POSSIBLE TO RECEIVE PERIODIC INFORMATION VIA EMAIL ABOUT ZARA\'S LATEST NEW PRODUCTS AND OFFERS?</h3>
<p>Yes. By simply clicking on Newsletter you will receive information on Zara\'s latest products, lookbook and events.</p>
</li>
<li>
<h3>CAN I CANCEL MY ZARA NEWSLETTER SUBSCRIPTION?</h3>
<p>You can easily cancel your subscription by clicking on the Newsletter menu. Fill in the details and select send.</p>
</li>
<li>
<h3>HOW DO I RECOVER MY FORGOTTEN PASSWORD?</h3>
<p>If you\'ve forgotten your password, you can recover it in the Log-in section. Enter your e-mail address and we\'ll send you an e-mail telling you what you need to do.</p>
</li>
<li>
<h3>HOW CAN I BE SURE THAT I\'VE MADE MY PURCHASE CORRECTLY?</h3>
<p>Once you have placed your order, you will receive a confirmation email. If you do not receive an email, contact our <a class=\" underline\" href=\"https://www.zara.com/in/en/z-contact-l1392.html?v1=11113\">customer service</a>.</p>
</li>
<li>
<h3>CAN I TRACK MY ORDER?</h3>
<p>Yes, you can see the updated status of your order in real time. To do this, go to the \"Orders and Returns\" section in your account.</p>
<p>If you are not registered, click on the \"Order Information\" link in the confirmation email sent to you.</p>
</li>
<li>
<h3>CAN I REMOVE ITEMS FROM MY ORDER?</h3>
<p>Yes. You can delete any unwanted items from your shopping bag as long as the order hasn‚Äôt been processed yet.</p>
</li>
<li>
<h3>CAN I CANCEL MY ORDER?</h3>
<p>Yes. You can cancel your order as long as its status allows you to. To do this, go to the \"Orders and Returns\" section in your account.</p>
<p>If you are not registered, click on the \"Order Information\" link in the confirmation email sent to you and click cancel.</p>
</li>
<li>
<h3>WHAT SHOULD I DO IF I RECEIVE A FAULTY ITEM?</h3>
<p>Zara.com only sells items in perfect condition so, in the rare event of receiving a faulty item, please contact our <a class=\" underline\" href=\"https://www.zara.com/in/en/z-contact-l1392.html?v1=11113\">customer service</a>.</p>
</li>
<li>
<h3>WHAT SHOULD I DO IF I RECEIVE AN INCORRECT ITEM?</h3>
<p>If you were to accidentally receive an item that you did not order, please contact our <a class=\" underline\" href=\"https://www.zara.com/in/en/z-contact-l1392.html?v1=11113\">customer service</a>.</p>
</li>
</ul>
